export default ({ date, title }) => {

    let list_col = [];
    let list_row = [];

    for (let i = 0; i <= title.length - 1; i++)
    {
         
        list_row.push(
                        <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                        </tr>
                    )
    }

    return (
        <div>
            <div class="row">
                <h1 id="eat-title">{title == null ? "???" : food[title]}</h1>
                <img src={imgs[title]} className={`rounded-circle ${title == null ? "invisible" : "visible"}`} id="food-img" />
            </div>
            <div class="row">
                <button type="button" class="btn btn-sm btn-outline-primary" onClick={onClick}>今天晚上吃什麼?</button>
            </div>
            <hr />
            <div class="row">
                <ul class="list-group list-group-horizontal">
                    {lists}
                </ul>
            </div>

            <table class="table">
                <thead class="thead-dark">
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    {list_row}
                </tbody>
            </table>
        </div>
    )
};
